import React from 'react';
import { HashRouter as Router, Route, Switch } from "react-router-dom";
import Home from './views/Home';
import Login from './views/Login';
import BindingCode from './views/BindingCode';
import BindingWallet from './views/BindingWallet';
import Payment from './views/Payment';
import UserCenter from './views/UserCenter';

export default class App extends React.Component {

  render(){
    return(
        <Router>
            <React.Suspense>
                <Switch>
                    <Route exact path="/home"  render={props => <Home {...props}/>} />
                    <Route exact path="/login"  render={props => <Login {...props}/>} />
                    <Route exact path="/binding-code"  render={props => <BindingCode {...props}/>} />
                    <Route exact path="/binding-wallet"  render={props => <BindingWallet {...props}/>} />
                    <Route exact path="/payment"  render={props => <Payment {...props}/>} />
                    <Route exact path="/user-center"  render={props => <UserCenter {...props}/>} />
                    <Route exact path="/"  render={props => <UserCenter {...props}/>} />
                </Switch>
            </React.Suspense>
        </Router>
    );
  }
}
